mapper.select:
SELECT DISTINCT A."hihokenshaNo" FROM rgdb."DbT2001ChoshuHoho" AS A WHERE to_char(to_date(#{ 抽出開始日時 }, 'yyyy-mm-dd hh24:mi:ss'),'yyyyMMDDhh24mmss') <= A."tokuchoTeishiNichiji" AND A."tokuchoTeishiNichiji" <= to_char(to_date(#{ 抽出終了日時 }, 'yyyy-mm-dd hh24:mi:ss'),'yyyyMMDDhh24mmss')
AND (A."fukaNendo" = #{ 調定年度minus1 } OR A."fukaNendo" = #{ 調定年度minus2 })
AND A."fukaNendo" = #{ 調定年度minus1 }

SELECT A.*,
FROM "KanendoHonSanteiChushutsuTmp" AS A LEFT JOIN rgdb."DbV2002Fuka" AS "DbT2002Fuka" ON A."tsuchishoNo" = "DbT2002Fuka"."tsuchishoNo" AND A."fukaNendo" = "DbT2002Fuka"."fukaNendo"
where A."fukaNendo" = #{ 調定年度minus1 }
where A."fukaNendo" = #{ 調定年度minus1 } OR A."fukaNendo" = #{ 調定年度minus2 }
